import React from "react";

const AboutUs = () => {
  const coFounders = [
    {
      name: "Anand Wanve",
      role: "Co-Founder",
      description:
        "Anand is a passionate entrepreneur with expertise in finance and technology. He is dedicated to creating innovative solutions for salary management. He ",
    },
    {
      name: "Amit Danole",
      role: "Co-Founder",
      description:
        "Amit is a technology enthusiast and software engineer. He has a deep understanding of system architecture and ensures the smooth operation of the Salary Management System.",
    },
    {
      name: "Minal Patil",
      role: "Co-Founder",
      description:
        "Minal is a skilled financial analyst with a keen eye for detail. She oversees the financial aspects of the Salary Management System, ensuring accuracy and compliance.",
    },
  ];

  return (
    <div className="container">
      <h2>About Us</h2>
      <p>
        The Salary Management System is a cutting-edge platform designed to
        simplify and streamline salary management processes for businesses of
        all sizes. Our system provides efficient solutions for calculating,
        managing, and distributing salaries, helping organizations save time and
        resources.
      </p>
      <p>
        At Salary Management System, we are committed to delivering
        user-friendly software with robust features that cater to the unique
        needs of HR departments and payroll managers. Our team of dedicated
        professionals combines expertise in finance, technology, and user
        experience to create a seamless and secure salary management experience.
      </p>
      <h3>Our Co-Founders</h3>
      <div className="row">
        {coFounders.map((coFounder, index) => (
          <div className="col-md-4" key={index}>
            <div className="card mb-4">
              <div className="card-body">
                <h5 className="card-title">{coFounder.name}</h5>
                <h6 className="card-subtitle mb-2">{coFounder.role}</h6>
                <p className="card-text">{coFounder.description}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
      <footer className="text-center mt-5">
        <p>&copy; 2023 Salary Management System. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default AboutUs;
